import ScheduleSelector from "react-schedule-selector";
import React from "react";

export default class Calendar extends React.Component {
  constructor(props) {
    super(props);
    console.log("props received = " + JSON.stringify(this.props.calendar));
    this.state = {
      schedule: this.props.calendar
    };
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange = (newSchedule) => {
    this.setState({
      schedule:
        newSchedule.length !== 0
          ? newSchedule
          : JSON.parse(
              JSON.stringify(this.props.calendar).substring(
                12,
                JSON.stringify(this.props.calendar).length - 1
              )
            )
    });
    this.props.handleSubmitCalendar(newSchedule);
    console.log("updating calendar " + JSON.stringify(this.props.calendar));
    console.log(this.props.calendar);
    console.log(this.state.schedule);
  };

  render() {
    console.log(this.props.calendar);
    console.log(this.state.schedule);

    return (
      <ScheduleSelector
        selection={this.state.schedule}
        numDays={5}
        minTime={9}
        maxTime={18}
        hourlyChunks={2}
        timeFormat={"hh:mm A"}
        dateFormat={"ddd"}
        startDate={"9-14-20"}
        margin={8}
        onChange={this.handleChange}
      />
    );
  }
}
